@Pdhenson : **Modifies Dockerfile to have docker install expect, which we use to execute a SSH command from docker to the physical machine (the Pi) which then modifies the iptables to block or allow whatever ip address it is fed.**


 @Ramsfield : If things seem weird, its because somebody and i'm not pointing fingers (@Pdhenson ) may have pushed to this master branch.


 But this commit is essentially creating the script to turn on and off assistants. We can run this from docker, and we have confirmed this works between our systems. @garrett1001 we'd like to work with you on communicating with the json. Currently our script aint smart enough to truly toggle and we were hoping you had a solution for us to be able to read your jsons for wether the device is active or not

@melippmann quick question for you and @ConnorGanaway .. Whoever sees this first I guess, 


 First, does script that @ConnorGanaway created provide any of the 2 left open checkboxes from above? if so, does it create the entire database or ?? what types of interactions does it have with the database? is it the same database as the SqlLite3 db that our Django models utilize? 


 I have some potential fixes for drop-box storage so would be nice to know what I have to work with && I'm also trying to close some of these issues I have open still from last sprint. Thanks

